import React from "react";

//Defining how my Note will look like
//We are "catching/rec" the props here, when we create a "Note" in the App.jsx so they ned to have the same in name as in App.jsx
function Note(params) {
  return (
    <div className="note">
      <h1>{params.title}</h1>
      <p>{params.content}</p>
    </div>
  );
}

export default Note;
